Uddeholmsverkens kronologi.&#13;
Uddeholms AB.&#13;
Ur Carl Sahlins bergshistoriska samling.

Posten i Trädet var en kombinerad postanordning&#13;
(lantbrevbäringspostställe t.o.m 31/12 1985) vilket innebar att&#13;
lantbrevbärare till viss del skötte verksamheten. Ortsadressen&#13;
ändrades till Blidsberg 3, 24/5 1971 och blev Blidsberg 1 när&#13;
poststationen omorganiserades till postställe 1/11 1973.&#13;
Lantbrevbäringen startade dock redan 1/6 1973. Från och med 1/11 1990&#13;
är postkontoret indraget.

